pragma solidity ^0.8.20;

contract Test {
    // 실행할 함수 데이터를 저장할 변수
    struct functionInfo {
        // address contractAddress;
        string name;
        uint256[] args;
    }

    // 스마트 계약으로 데이터를 전달하는 함수
    function initialPlay(functionInfo[] memory functionInfos) public returns (functionInfo[] memory) {

        return functionInfos;
        // for (uint i = 0; i < functionInfos.length; i++) {
        //     // 각 객체에서 정보 추출
        //     address contractAddress = functionInfos[i].contractAddress;
        //     string memory functionName = functionInfos[i].name;
        //     uint256[] memory args = functionInfos[i].args;

        //     // 원하는 함수를 호출
        //     (bool success, ) = contractAddress.call(abi.encodeWithSignature(functionName, args));

        //     // 성공 여부 확인
        //     require(success, "Function call failed");
        // }


        // 데이터를 ABI 인코딩하여 바이트 배열로 변환
        // bytes memory data = abi.encodeWithSignature("setData(uint256)", newData);

        // 스마트 계약으로 데이터를 전송
        // (bool success, ) = contractAddress.call(data);
        // require(success, "Data sending failed");
    }
}

